const ProjectPreview = ({imageSrc, imageAlt, title}) => {
  return (
    <div className="card">
      <a href={project/{id}}>
        <img src={imageSrc} alt={imageAlt} className="card__image" />
        <h3 className="card__title">{title}</h3>
      </a>
    </div>
  )
}

export default ProjectPreview;
